@generated function max_degree_poly(::Val{N}, l::Int, T = Int) where N
    quote
        j_0 = l
        s_0 = 0
        out = Vector{NTuple{N,T}}(0)
        @nloops $N i p -> begin
            0:j_{$N-p}
        end p -> begin
            s_{$N-p+1} = s_{$N-p} + i_p
            j_{$N-p+1} = l - s_{$N-p+1}
        end begin
            push!(out, (@ntuple $N j -> T(i_{j})) )
        end
        out
    end
end
function tupGridd(x::NTuple{N,T}) where {N,T<:Integer}
    Expr(:call, :*, ntuple(i -> gen_diff(x[i], i), Val{N}())... )
end
function tupGridd(x::NTuple{N,T}, j::Integer) where {N,T<:Integer}
    Expr(:call, :*, ntuple(i -> gen_diff(x[i], i, j), Val{N}())... )
end
function tupGriddD(x::NTuple{N,T}, j::Integer) where {N,T<:Integer}
    Expr(:call, :*, ntuple(i -> gen_diffD(x[i], i, j), Val{N}())... )
end
gen_diff(v, i) = v > 0 ? :( $(Symbol('`' + i, :_, v)) - $(Symbol('`' + i, :_, v-1)) ) : Symbol('`' + i, :_, v)
function gen_diff(v, i, j)
    letter = '`' + i
    if i == j
        out = :( $(Symbol(:d, letter, :_, v)) - $(Symbol(letter, :_, v)) )
    elseif v > 0
        out = :( $(Symbol(letter, :_, v)) - $(Symbol(letter, :_, v-1)) )
    else
        out = Symbol(letter, :_, v)
    end
    out
end

function gen_diffD(v, i, j)
    letter = '`' + i
    if i == j
        out = Symbol(:d, letter, :_, v)
    elseif v > 0
        out = :( $(Symbol(letter, :_, v)) - $(Symbol(letter, :_, v-1)) )
    else
        out = Symbol(letter, :_, v)
    end
    out
end

function process_weights_no_deriv(x::Vector{NTuple{N,Int}}) where N
    if length(x) == 1
        return tupGridd(x[1])
    end
    expr = Expr(:call, :+, tupGridd(x[1]), tupGridd(x[2]) )
    for i in 3:length(x)
        push!(expr.args, tupGridd(x[i]) )
    end
    expr
end

function process_weights(x::Vector{NTuple{N,Int}}) where N
    expr = Expr(:call, :+, tupGridd(x[1]), tupGridd(x[1], 1) )
    for j in 2:N
        push!(expr.args, tupGridd(x[1], j) )
    end
    for i in 2:length(x)
        push!(expr.args, tupGridd(x[i]) )
        for j in 1:N
            push!(expr.args, tupGridd(x[i], j) )
        end
    end
    expr
end


function process_weights(x::Vector{NTuple{N,Int}}, deriv::Int) where N
    if length(x) == 1
        return tupGriddD(x[1], deriv)
    end
    expr = Expr(:call, :+, tupGriddD(x[1], deriv), tupGriddD(x[2], deriv) )
    for j in 3:length(x)
        push!(expr.args, tupGriddD(x[j], deriv) )
    end
    expr
end


