function weights(::Val{N}, l::Int) where N
    p1 = max_degree_poly(Val{N}(), l)
    s1 = process_weights(p1)
    rcall(s1, :expand)::Expr
end
function weights(::Val{N}, l::Int, deriv::Int) where N
    p1 = max_degree_poly(Val{N}(), l)
    s1 = process_weights(p1, deriv)
    rcall(s1, :expand)::Expr
end
@generated weights(::Val{N}, ::Val{l}) where {N,l} = weights(Val{N}(), l)

@generated function calc_weights(::Val{L}, l::I, m::NTuple{N,I}, mcourse::NTuple{N,I}) where {L,N,I<:Integer}
    quote
        @nif $L i -> i == l i -> begin
            weight = calc_weights(Val{i}(), m, mcourse)
        end
        weight
    end
end


function inds(i::I, j::I, m::NTuple{N,I}, mcourse::NTuple{N,I}) where {N,I<:Integer}
    distbase = mcourse[i]
    distcurrent =  j-1 + mcourse[i]
    distcurrent, cld(hermite_weights[distcurrent],2) + m[i] - cld(length(hermite_weights[distbase]),2)
end

@generated function calc_weights(::Val{L}, m::NTuple{N,I}, mcourse::NTuple{N,I}) where {L,N,I<:Integer}
    weight_expr = weights(Val{N}(), L)
    Lp1 = L+1
    quote
        @nexprs $N i -> begin
            @nexprs $Lp1 j -> begin
                i1, i2 = inds(i, j, m, mcourse)
                $(Symbol(     '`' + i, :_, j-1 )) = $hermite_weights[ i1 ][ 2i2-1 ]
                $(Symbol(:d,  '`' + i, :_, j-1 )) = $hermite_weights[ i1 ][ 2i2   ]
            end
        end

        $weight_expr
    end
end

@generated function calc_weights(::Val{L}, m::NTuple{N,I}, mcourse::NTuple{N,I}, deriv::I) where {L,N,I<:Integer}
    weight_expr = weights(Val{N}(), L, deriv)
    Lp1 = L+1
    quote
        @nexprs $N i -> begin
            @nexprs $Lp1 j -> begin
                i1, i2 = inds(i, j, m, mcourse)
                $(Symbol(     '`' + i, :_, j-1 )) = $hermite_weights[ i1 ][ 2i2-1 ]
                $(Symbol(:d,  '`' + i, :_, j-1 )) = $hermite_weights[ i1 ][ 2i2   ]
            end
        end

        $weight_expr
    end
end

